import React from 'react';

import classes from './Facing.css';

const Facing = (props) => {
  const name = props.name.toLocaleString('en-US', { name: 'long' });
  const upc = props.upc.toLocaleString('en-US', { upc: '2-digit' });
  const facing = props.facing.getFullYear();

  return (
    <div className='facing-product'>
      <div className='facing-product__name'>{name}</div>
      <div className='facing-product__upc'>{upc}</div>
      <div className='facing-product__facing'>{facing}</div>
    </div>
